INSERT INTO `campaigns` VALUES (1,1,2,'Codegnan','info@codegnan.com','info@codegnan.com','Answers to yesterday\\\'s Python Quiz by Codegnan','','','<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Hello [Name],</p>\r\n\r\n<p>Hope you are having a nice weekend! As you might already knew, we have been doing these weekly quizes and giving away 2000 INR off on our courses to people who answers all the questions right on every Friday of that month.<br />\r\n<br />\r\nTo not miss the chance, Hit the &#39;<strong><a href=\"https://m.me/codegnan?ref=:t-1601018222458\">Notify Me</a></strong>&#39; to get the quiz in your Messenger on every Friday!</p>\r\n\r\n<p>You received this email because you have answered all the questions on Friday in the quiz bot and opted for explanations. Here you go!</p>\r\n\r\n<p dir=\"ltr\"><br />\r\n<strong>Q1. What will be the output of the following Python code?</strong></p>\r\n\r\n<p dir=\"ltr\">True = False</p>\r\n\r\n<p dir=\"ltr\">while True:</p>\r\n\r\n<p dir=\"ltr\">&nbsp; print(True)</p>\r\n\r\n<p dir=\"ltr\">&nbsp; break</p>\r\n\r\n<p dir=\"ltr\"><strong>Options: </strong>None , False , Error , True</p>\r\n\r\n<p dir=\"ltr\"><strong>Answer: </strong>The correct answer is Error. we cannot use keyword as variable name &quot;True&quot; is a keyword in python so assignment is not possible</p>\r\n\r\n<p dir=\"ltr\"><br />\r\n<strong>Q2. What will be the output of the following python code?</strong></p>\r\n\r\n<p dir=\"ltr\">x = [&#39;ab&#39;, &#39;cd&#39;]</p>\r\n\r\n<p dir=\"ltr\">for i in x:</p>\r\n\r\n<p dir=\"ltr\">&nbsp;&nbsp;&nbsp;&nbsp;x.append(i.upper())</p>\r\n\r\n<p dir=\"ltr\">print(x)</p>\r\n\r\n<p dir=\"ltr\"><strong>Options:</strong> [&#39;ab&#39;,&#39;cd&#39;] , [&#39;AB&#39;,&#39;CD&#39;] , [&#39;ab&#39;,&#39;cd&#39;,&#39;AB&#39;,&#39;CD&#39;] , None of the above</p>\r\n\r\n<p dir=\"ltr\"><strong>Answer</strong>: The correct option is None of the above. This will go into an infinity loop as we are appending the values in list after each iteration</p>\r\n\r\n<p dir=\"ltr\"><strong>Q3. What will be the output of the following python code?</strong></p>\r\n\r\n<p dir=\"ltr\">a= &#39;vxyaaxaxzxy&#39;</p>\r\n\r\n<p dir=\"ltr\">print(a.count(&lsquo;vbb&rsquo;,-10,-1))</p>\r\n\r\n<p dir=\"ltr\"><strong>Options:&nbsp;</strong> 2 , 3 , 1 , 0</p>\r\n\r\n<p dir=\"ltr\"><strong>Answer</strong>: The correct option is 0. It Counts the number of times the substring &lsquo;vbb&rsquo; is present starting from position 2 and ending at position 11 in the given string and it gives 0 because of no findings</p>\r\n\r\n<p dir=\"ltr\"><br />\r\n<strong>Q4. What will be the output of the following&nbsp; code?</strong></p>\r\n\r\n<p dir=\"ltr\">var= &quot;Michael Jackson&quot;</p>\r\n\r\n<p dir=\"ltr\">print(var[2::-2])</p>\r\n\r\n<p dir=\"ltr\"><strong>Options: </strong>Mic , caM&nbsp; , cM , Mac</p>\r\n\r\n<p dir=\"ltr\"><strong>Answer</strong>: The correct option is cM. Output is &#39;cM&#39; on basis of indexing</p>\r\n\r\n<p dir=\"ltr\">var[::-2]</p>\r\n\r\n<p dir=\"ltr\">&#39;nscJlacM&#39;</p>\r\n\r\n<p dir=\"ltr\">var[2::-2]</p>\r\n\r\n<p dir=\"ltr\">&#39;cM&#39;</p>\r\n\r\n<p dir=\"ltr\"><strong>Q5.what will be output of following code:</strong></p>\r\n\r\n<p dir=\"ltr\">def outerFun(a, b):</p>\r\n\r\n<p dir=\"ltr\">&nbsp; &nbsp; &nbsp; def innerFun(c, d):</p>\r\n\r\n<p dir=\"ltr\">&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; return c + d</p>\r\n\r\n<p dir=\"ltr\">&nbsp; &nbsp; return innerFun(a, b)</p>\r\n\r\n<p dir=\"ltr\">&nbsp;res = outerFun(5, 10)</p>\r\n\r\n<p dir=\"ltr\" role=\"presentation\">print(res)</p>\r\n\r\n<p dir=\"ltr\" role=\"presentation\"><strong>Options: </strong>Syntax Error , Runtime Error , 15 , (5,10)</p>\r\n\r\n<p dir=\"ltr\"><strong>Answer</strong>: The correct option is 15. The two values will be added in innerFun () function through calling at outerFun() function</p>\r\n\r\n<p dir=\"ltr\">&nbsp;</p>\r\n\r\n<p dir=\"ltr\">Looking forward to seeing you answering the next Friday&#39;s quiz.</p>\r\n\r\n<p dir=\"ltr\">&nbsp;</p>\r\n\r\n<p dir=\"ltr\">Thank you,<br />\r\nSaketh</p>\r\n</body>\r\n</html>\r\n','','1602411235',27,'3',27,NULL,'61:US,43:IN,60:US,40:US,38:US,54:US,54:US,53:US,37:US,58:US,58:US,51:US,36:US,47:US,38:US,53:US',1,NULL,NULL,'3','','','',NULL,NULL,0,0,1,1),(3,1,2,'Codegnan','info@codegnan.com','info@codegnan.com','Explanation you requested for yesterday\\\'s Python Quiz by Codegnan','','','<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Hello [Name],</p>\r\n\r\n<p>Hope you are having a nice weekend! As you might already knew, we have been doing these weekly quizes and giving away 2000 INR off on our courses to people who answers all the questions right on every Friday of that month.<br />\r\n<br />\r\nTo not miss the chance, Hit the &#39;<strong><a href=\"https://m.me/codegnan?ref=:t-1601018222458\">Notify Me</a></strong>&#39; to get the quiz in your Messenger on every Friday!<br />\r\n<br />\r\nBy the way, the dates for the next batch Machine Learning and Augmented Reality courses were announced. <strong><a href=\"https://codegnan.com/courses/?utm_source=weeklyquiz&amp;utm_medium=email&amp;utm_campaign=Courses\">Click here</a></strong> to check out full length course structures in detail!</p>\r\n\r\n<p>You received this email because you have answered all the questions on Friday in the quiz bot and opted for explanations. Here you go!</p>\r\n\r\n<p dir=\"ltr\"><br />\r\n<strong>Q1.</strong> What does ~~~~~~5 evaluate to?</p>\r\n\r\n<p dir=\"ltr\"><strong>Options: </strong>+5 , -11 , -5 , +11</p>\r\n\r\n<p dir=\"ltr\" style=\"line-height:2.625;margin-right: 2pt;text-align: justify;background-color:#ffffff;margin-top:6pt;margin-bottom:7pt;\"><strong>Answer: </strong>The correct answer is +5.<b id=\"docs-internal-guid-7b75885f-7fff-7bfb-0f01-3a56ffed9488\" style=\"font-weight:normal;\"><span style=\"font-size:11.5pt;font-family:Roboto,sans-serif;color:#29303b;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\"> </span></b> ~x is equivalent to -(x+1)</p>\r\n\r\n<p dir=\"ltr\"><strong>Q2.</strong> What will be the output of<br />\r\nprint(max(&ldquo;what are you&rdquo;))</p>\r\n\r\n<p dir=\"ltr\"><strong>Options:</strong> error , u , y, a</p>\r\n\r\n<p dir=\"ltr\"><strong>Answer</strong>: The correct option is y. <meta charset=\"utf-8\">Max returns the character with the highest ascii value.</p>\r\n\r\n<p><br />\r\n<strong>Q3. Which of the following is incorrect ?</strong></p>\r\n\r\n<p><strong>Options:&nbsp;</strong> float(&#39;inf&#39;) , float(&#39;12+13&#39;) , float(&#39;nan&#39;) , float(&#39;12+&quot;13&quot;)</p>\r\n\r\n<p dir=\"ltr\"><strong>Answer</strong>: The correct option is float(&#39;12+13&#39;). + cannot be converted to a float.</p>\r\n\r\n<p dir=\"ltr\"><br />\r\n<strong>Q4. What will be the output of the following&nbsp; code?</strong></p>\r\n\r\n<p dir=\"ltr\">class father:<br />\r\n&nbsp;&nbsp; def __init__(self, param):<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; self.o1 = param<br />\r\nclass child(father):<br />\r\n&nbsp;&nbsp; def __init__(self, param):<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; self.o2 = param<br />\r\nobj = child(22)<br />\r\nprint( &quot;%d %d&quot; % (obj.o1, obj.o2))</p>\r\n\r\n<p dir=\"ltr\"><strong>Options: </strong>None None , None 22 , 22 None , Error</p>\r\n\r\n<p dir=\"ltr\"><strong>Answer</strong>: The correct option is Error. self .o1 was never created</p>\r\n\r\n<p dir=\"ltr\"><br />\r\n<strong>Q5.what will be output of following Python code:</strong></p>\r\n\r\n<p dir=\"ltr\">print(0xA + 0xB + 0xC)</p>\r\n\r\n<p dir=\"ltr\" role=\"presentation\"><strong>Options: </strong>0xA0xB0xC , Error , 0x22 , 33</p>\r\n\r\n<p dir=\"ltr\"><strong>Answer</strong>: The correct option is 33. 0xA and 0xB and 0xC are hexadecimal integer literal representing the decimal values 10, 11 and 12 respectively. Their sum is 33.</p>\r\n\r\n<p dir=\"ltr\">Looking forward to seeing you answering the next Friday&#39;s quiz.</p>\r\n\r\n<p dir=\"ltr\">&nbsp;</p>\r\n\r\n<p dir=\"ltr\">Thank you,<br />\r\nSaketh<br />\r\n<a href=\"https://codegnan.com/courses/?utm_source=weeklyquiz&amp;utm_medium=email&amp;utm_campaign=Courses\">200 Hours of Courses - Details</a></p>\r\n\r\n<p>&nbsp;</p>\r\n</body>\r\n</html>\r\n','','1602913820',17,'',17,NULL,'77:US,76:US,38:US,48:US,72:US,42:US,70:US,40:US,54:US,70:US,73:US,73:US,73:US',1,NULL,NULL,'','','2','',NULL,NULL,0,0,1,1),(4,1,2,'Codegnan','info@codegnan.com','info@codegnan.com','Python Quiz Answers and Explanation','','','<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Hello [Name],</p>\r\n\r\n<p>Hope you are having a nice weekend! As you might already knew, we have been doing these weekly quizes and giving away 2000 INR off on our courses to people who answers all the questions right on every Friday of that month.<br />\r\n<br />\r\nTo not miss the chance, Hit the &#39;<a href=\"https://m.me/codegnan?ref=:t-1601018222458\">Notify Me</a>&#39; to get the quiz in your Messenger on every Friday!<br />\r\n<br />\r\nBy the way, the dates for the next batch Machine Learning and Augmented Reality courses were announced. <a href=\"https://codegnan.com/courses/?utm_source=weeklyquiz&amp;utm_medium=email&amp;utm_campaign=Courses\">Click here</a> to check out full length course structures in detail!</p>\r\n\r\n<p>You received this email because you have answered all the questions on Friday in the quiz bot and opted for explanations. Here you go!</p>\r\n\r\n<p dir=\"ltr\"><br />\r\n<strong>Q1. What is the output of the following program?</strong><br />\r\nD = dict()<br />\r\nfor x in enumerate(range(2)):<br />\r\n&nbsp; D[x[0]] = x[1]<br />\r\n&nbsp; D[x[1]+7] = x[0]<br />\r\nprint(D)</p>\r\n\r\n<p dir=\"ltr\"><strong>Options: </strong> <meta charset=\"utf-8\">&nbsp;KeyError , <meta charset=\"utf-8\">{0: 1, 7: 0, 1: 1, 8: 0} , <meta charset=\"utf-8\">{0: 0, 7: 0, 1: 1, 8: 1}&nbsp; , <meta charset=\"utf-8\">{1: 1, 7: 2, 0: 1, 8: 1}</p>\r\n\r\n<p dir=\"ltr\"><strong>Answer</strong>: The correct answer is <meta charset=\"utf-8\">{0: 1, 7: 0, 1: 1, 8: 0}. Because,</p>\r\n\r\n<p dir=\"ltr\">enumerate will give tuples (0,0) in the first iteration and (1,1) in the second iteration.&nbsp;</p>\r\n\r\n<p dir=\"ltr\"><strong>Q2. What will be the output of the following Python code?</strong><br />\r\nX = [12,34]<br />\r\nprint(len(&lsquo; &rsquo;.join(list(map(int,x))))</p>\r\n\r\n<p dir=\"ltr\"><strong>Options</strong>: 4 , 2 , Error , None</p>\r\n\r\n<p dir=\"ltr\"><strong>Answer</strong>: The correct option is Error. Because, <meta charset=\"utf-8\">Cannot perform join on a list of ints</p>\r\n\r\n<p><br />\r\n<strong>Q3. What will be the output of the following Python code?</strong><br />\r\nimport re<br />\r\nprint(re.subn(&#39;A&#39;, &#39;X&#39;, &#39;AAAAAA&#39;, count=4))</p>\r\n\r\n<p dir=\"ltr\"><strong>Options</strong>:&nbsp; <meta charset=\"utf-8\">&lsquo;XXXXAA, 4&rsquo;&nbsp; ,&nbsp; (&lsquo;AAAAAA&rsquo;, 4) , (&lsquo;XXXXAA&rsquo;, 4) , <meta charset=\"utf-8\">&lsquo;AAAAAA, 4&rsquo;</p>\r\n\r\n<p dir=\"ltr\"><strong>Answer:</strong> The correct option is (&lsquo;XXXXAA&rsquo;, 4). Because, <meta charset=\"utf-8\">The line of code shown above demonstrates the function re.subn. This function is very similar to the function re.sub except that in the former, a tuple is returned instead of a string. The output of the code shown above is: (&lsquo;XXXXAA&rsquo;, 4).</p>\r\n\r\n<p><br />\r\n<strong>Q4.&nbsp; What will be the output of the following Python code?</strong><br />\r\n&nbsp; A = [[1, 2, 3],<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; [4, 5, 6],<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; [7, 8, 9]]<br />\r\n&nbsp;<br />\r\nprint([[col + 10 for col in row] for row in A])</p>\r\n\r\n<p dir=\"ltr\"><strong>Options</strong>: [[11, 12, 13], [14, 15, 16], [17, 18, 19]] , Error , <meta charset=\"utf-8\">[11, 12, 13], [14, 15, 16], [17, 18, 19] , <meta charset=\"utf-8\">[11, 12, 13, 14, 15, 16, 17, 18, 19]</p>\r\n\r\n<p dir=\"ltr\"><strong>Answer</strong>: The correct option is[[11, 12, 13], [14, 15, 16], [17, 18, 19]]. Because, <meta charset=\"utf-8\">The code shown above shows a list comprehension which adds 10 to each element of the matrix A and prints it row-wise. Hence the output of the code is: [[11, 12, 13], [14, 15, 16], [17, 18, 19]]</p>\r\n\r\n<p dir=\"ltr\"><br />\r\n<strong>Q5. Find the output of the code ?</strong><br />\r\ndef f(a, b = 1, c = 2):<br />\r\n&nbsp;&nbsp; print(&#39;a is: &#39;,a, &#39;b is: &#39;, b, &#39;c is: &#39;, c)<br />\r\nf(2, c = 2)<br />\r\nf(c = 100, a = 110)</p>\r\n\r\n<p dir=\"ltr\"><strong>Options</strong>:<br />\r\n<br />\r\n1.&nbsp; a is: 2 b is: 1 c is: 2<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; a is: 110 b is: 1 c is: 100</p>\r\n\r\n<p dir=\"ltr\">&nbsp;</p>\r\n\r\n<p dir=\"ltr\"><meta charset=\"utf-8\">2.&nbsp; a is: 2 b is: 2 c is: 2<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; a is: 110 b is: 2 c is: 100</p>\r\n\r\n<p><meta charset=\"utf-8\"></p>\r\n\r\n<p dir=\"ltr\" role=\"presentation\">3.&nbsp; a is: 0 b is: 2 c is: 2<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; a is: 110 b is: 0 c is: 100</p>\r\n\r\n<p dir=\"ltr\">4.&nbsp; a is: 110 b is: 0 c is: 100<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; a is: 110 b is: 0 c is: 100</p>\r\n\r\n<p dir=\"ltr\"><strong>Answer</strong>: The correct option is option 1.</p>\r\n\r\n<p dir=\"ltr\">while calling f(2, c = 2) ,a is initialized with 2 and b is initialized with 1 by default and c is initialised with 2 and prints a is: 2 b is: 1 c is: 2 , while calling f(c = 100, a = 110) , a is initialized with 110 and c is initialized with 100 through initializing it&rsquo;s attributes and b initialized with 1 by default and prints&nbsp; a is: 110 b is: 1 c is: 100</p>\r\n\r\n<p dir=\"ltr\">Looking forward to seeing you answering the next Friday&#39;s quiz.</p>\r\n\r\n<p dir=\"ltr\">&nbsp;</p>\r\n\r\n<p dir=\"ltr\">Thank you,<br />\r\nSaketh<br />\r\n<a href=\"https://codegnan.com/courses/?utm_source=weeklyquiz&amp;utm_medium=email&amp;utm_campaign=Courses\">200 Hours of Courses - Details</a></p>\r\n\r\n<p>&nbsp;</p>\r\n</body>\r\n</html>\r\n','','1603529705',14,'',14,NULL,'138:,139:US,38:US',1,NULL,NULL,'','','3','',NULL,NULL,0,0,1,1),(5,1,2,'Codegnan','info@codegnan.com','info@codegnan.com','Python Quiz Answers and Explanation','','','<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Hello Codegnan,</p>\r\n\r\n<p>Hope you are having a nice weekend! As you might already knew, we have been doing these weekly quizes and giving away 2000 INR off on our courses to people who answers all the questions right on every Friday of that month.<br />\r\n<br />\r\nTo not miss the chance, Hit the &#39;<a href=\"https://m.me/codegnan?ref=:t-1601018222458\">Notify Me</a>&#39; to get the quiz in your Messenger on every Friday!<br />\r\n<br />\r\nBy the way, the dates for the next batch Machine Learning and Augmented Reality courses were announced. <a href=\"https://codegnan.com/courses/?utm_source=weeklyquiz&amp;utm_medium=email&amp;utm_campaign=Courses\">Click here</a> to check out full length course structures in detail!</p>\r\n\r\n<p>You received this email because you have answered all the questions on Friday in the quiz bot and opted for explanations. Here you go!</p>\r\n\r\n<p dir=\"ltr\"><br />\r\n<strong>Q1. What is the output of the following program?</strong></p>\r\n\r\n<p dir=\"ltr\">def to_upper(k):</p>\r\n\r\n<p dir=\"ltr\">&nbsp;&nbsp;&nbsp;&nbsp;k.upper()</p>\r\n\r\n<p dir=\"ltr\">x = [&#39;ab&#39;, &#39;cd&#39;]</p>\r\n\r\n<p dir=\"ltr\">print(list(map(to_upper, x)))</p>\r\n\r\n<p dir=\"ltr\"><strong>Options: </strong> &nbsp; [&lsquo;AB&rsquo;, &lsquo;CD&rsquo;] , [&lsquo;ab&rsquo;, &lsquo;cd&rsquo;] , none of the mentioned&nbsp; , error</p>\r\n\r\n<p dir=\"ltr\"><strong>Answer</strong>: The correct answer is none. Because, a list of Nones is printed as to_upper() returns None.</p>\r\n\r\n<p dir=\"ltr\"><br />\r\n<strong>Q2. What will be the output of the following Python code?</strong></p>\r\n\r\n<p dir=\"ltr\">&nbsp;</p>\r\n\r\n<p dir=\"ltr\">class Truth:</p>\r\n\r\n<p dir=\"ltr\">pass</p>\r\n\r\n<p dir=\"ltr\">x=Truth()</p>\r\n\r\n<p dir=\"ltr\">print(bool(x))</p>\r\n\r\n<p dir=\"ltr\"><strong>Options</strong>: Pass , True , False , error</p>\r\n\r\n<p dir=\"ltr\"><strong>Answer</strong>: The correct option is True. Because, If the truth method is not defined, the object is considered true. Hence the output of the code shown above is true.</p>\r\n\r\n<p><br />\r\n<strong>Q3. What is the value of the following expression?</strong><br />\r\n24//6%3, 24//4//2</p>\r\n\r\n<p dir=\"ltr\"><strong>Options</strong>:&nbsp; (1,3) , (0,3) , (1,0) , (3,1)</p>\r\n\r\n<p dir=\"ltr\"><strong>Answer:</strong> The correct option is (1,3). Because, The expressions are evaluated as: 4%3 and 6//2 respectively. This results in the answer (1,3). This is because the associativity of both of the expressions shown above is left to right.</p>\r\n\r\n<p dir=\"ltr\"><br />\r\n<strong>Q4.&nbsp; What will be the output of the code shown below?</strong><br />\r\n&nbsp;<br />\r\nimport math</p>\r\n\r\n<p dir=\"ltr\">print([str(round(math.pi)) for i in range (1, 6)])</p>\r\n\r\n<p dir=\"ltr\"><strong>Options</strong>:<br />\r\n[&lsquo;3&rsquo;, &lsquo;3&rsquo;, &lsquo;3&rsquo;, &lsquo;3&rsquo;, &lsquo;3&rsquo;, &lsquo;3&rsquo;] ,<br />\r\n[&lsquo;3.1&rsquo;, &lsquo;3.14&rsquo;, &lsquo;3.142&rsquo;, &lsquo;3.1416&rsquo;, &lsquo;3.14159&rsquo;, &lsquo;3.141582&rsquo;]&nbsp; ,<br />\r\n[&lsquo;3&rsquo;, &lsquo;3&rsquo;, &lsquo;3&rsquo;, &lsquo;3&rsquo;, &lsquo;3&rsquo;]&nbsp; , &nbsp;<br />\r\n[&lsquo;3.1&rsquo;, &lsquo;3.14&rsquo;, &lsquo;3.142&rsquo;, &lsquo;3.1416&rsquo;, &lsquo;3.14159&rsquo;]</p>\r\n\r\n<p dir=\"ltr\"><strong>Answer</strong>: The correct option is [&lsquo;3&rsquo;, &lsquo;3&rsquo;, &lsquo;3&rsquo;, &lsquo;3&rsquo;, &lsquo;3&rsquo;]. Because, The list comprehension shown above rounds off pi(3.141) and returns its value, that is 3. This is done 5 times. Hence the output is: [&lsquo;3&rsquo;, &lsquo;3&rsquo;, &lsquo;3&rsquo;, &lsquo;3&rsquo;, &lsquo;3&rsquo;].</p>\r\n\r\n<p dir=\"ltr\"><br />\r\n<strong>Q5. Find the output of the following?</strong><br />\r\nprint(&#39;xyyxyyxyxyxxy&#39;.replace(&#39;xy&#39;, &#39;12&#39;, 100))</p>\r\n\r\n<p dir=\"ltr\"><strong>Options</strong>: xyyxyyxyxyxxy&nbsp; , 12y12y1212x12&nbsp; , none of the mentioned , error</p>\r\n\r\n<p dir=\"ltr\"><strong>Answer</strong>: The correct option is option 12y12y1212x12&nbsp;.</p>\r\n\r\n<p dir=\"ltr\">The first 100 occurences of the given substring are replaced.</p>\r\n\r\n<p dir=\"ltr\">Looking forward to seeing you answering the next Friday&#39;s quiz.</p>\r\n\r\n<p dir=\"ltr\">&nbsp;</p>\r\n\r\n<p dir=\"ltr\">Thank you,<br />\r\nSaketh<br />\r\n<a href=\"https://codegnan.com/courses/?utm_source=weeklyquiz&amp;utm_medium=email&amp;utm_campaign=Courses\">200 Hours of Courses - Details</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n</body>\r\n</html>\r\n','','1604109165',14,'',14,NULL,'158:CA,42:US,160:US,61:US,162:US,38:US,42:US,70:US',1,NULL,NULL,'','','4','',NULL,NULL,0,0,1,1),(6,1,2,'Codegnan','info@codegnan.com','info@codegnan.com','What is your Friday\\\'s Python Quiz Score','','','<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Hello [Name],</p>\r\n\r\n<p>Hope you are enjoying the weekly Python quiz!</p>\r\n\r\n<p>We have been doing these weekly quizes and giving away 2000 INR off on our courses to people who answers all the questions right on every Friday of that month.</p>\r\n\r\n<p>Since yesterday was the first Friday of November, continue answering the next three Fridays as well.<br />\r\n<br />\r\nTo not miss the chance, Hit the &#39;<a href=\"https://m.me/codegnan?ref=:t-1601018222458\">Notify Me</a>&#39; to get the quiz in your Messenger on every Friday!<br />\r\n<br />\r\nBy the way, the dates for the next batch Machine Learning and Augmented Reality courses were announced. <a href=\"https://codegnan.com/courses/?utm_source=weeklyquiz&amp;utm_medium=email&amp;utm_campaign=Courses\">Click here</a> to check out full length course structures in detail!</p>\r\n\r\n<p>You received this email because you have answered all the questions on Friday in the quiz bot and opted for explanations. Here you go!</p>\r\n\r\n<p dir=\"ltr\"><br />\r\n<strong>Q1. What is the output after the following statements?</strong></p>\r\n\r\n<p dir=\"ltr\">for i in range(1,25,0.5):<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; print(i, end=&#39; &#39;)</p>\r\n\r\n<p dir=\"ltr\"><strong>Options:&nbsp; </strong></p>\r\n\r\n<p dir=\"ltr\">a. 1 6 11 16 21&nbsp;</p>\r\n\r\n<p>b. error</p>\r\n\r\n<p dir=\"ltr\">c. 1 5 25&nbsp;</p>\r\n\r\n<p dir=\"ltr\">d. 16111621&nbsp;</p>\r\n\r\n<p dir=\"ltr\"><strong>Answer</strong>: The correct answer is error. Because, we cannot give the step size as floating point in range function.</p>\r\n\r\n<p dir=\"ltr\"><br />\r\n<strong>Q2. What will be the output after the following statements?</strong></p>\r\n\r\n<p dir=\"ltr\">x = [&#39;P&#39;, &#39;y&#39;, &#39;t&#39;, &#39;h&#39;, &#39;o&#39;, &#39;n&#39;]<br />\r\nfor i in enumerate(x):<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; print(i, end=&#39;&#39;)</p>\r\n\r\n<p dir=\"ltr\"><strong>Options</strong>:</p>\r\n\r\n<p dir=\"ltr\">a. (&#39;P&#39;)(&#39;y&#39;)(&#39;t&#39;)(&#39;h&#39;)(&#39;o&#39;)(&#39;n&#39;)&nbsp;</p>\r\n\r\n<p dir=\"ltr\">b. ( &#39;P&#39;,0),( &#39;y&#39;,1),(&#39;t&#39;,2),(&#39;h&#39;,3),(&#39;o&#39;,4),(&#39;n&#39;,5)</p>\r\n\r\n<p dir=\"ltr\">c. &lsquo;Python&rsquo;&nbsp;</p>\r\n\r\n<p dir=\"ltr\">d. (0, &#39;P&#39;)(1, &#39;y&#39;)(2, &#39;t&#39;)(3, &#39;h&#39;)(4, &#39;o&#39;)(5, &#39;n&#39;)</p>\r\n\r\n<p dir=\"ltr\"><strong>Answer</strong>: The correct answer is d.</p>\r\n\r\n<p><br />\r\n<strong>Q3. What is the output after the following statements?</strong><br />\r\n<br />\r\nx = [&#39;p&#39;, &#39;y&#39;, &#39;t&#39;, &#39;h&#39;, &#39;o&#39;, &#39;n&#39;]<br />\r\ny = [&#39;0&#39;, &#39;1&#39;, &#39;2&#39;, &#39;3&#39;, &#39;4&#39;, &#39;5&#39;]<br />\r\nfor i in zip(x, y):<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; print(i, end=&#39;&#39;)</p>\r\n\r\n<p dir=\"ltr\"><strong>Options</strong>:&nbsp;</p>\r\n\r\n<p dir=\"ltr\">a. (&#39;P&#39;)(&#39;y&#39;)(&#39;t&#39;)(&#39;h&#39;)(&#39;o&#39;)(&#39;n&#39;)&nbsp;</p>\r\n\r\n<p dir=\"ltr\">b. python 0 1 2 3 4 5&nbsp;</p>\r\n\r\n<p dir=\"ltr\">c. (&#39;p&#39;, &#39;0&#39;)(&#39;y&#39;, &#39;1&#39;)(&#39;t&#39;, &#39;2&#39;)(&#39;h&#39;, &#39;3&#39;)(&#39;o&#39;, &#39;4&#39;)(&#39;n&#39;, &#39;5&#39;)&nbsp;</p>\r\n\r\n<p dir=\"ltr\">d. (0, &#39;P&#39;)(1, &#39;y&#39;)(2, &#39;t&#39;)(3, &#39;h&#39;)(4, &#39;o&#39;)(5, &#39;n&#39;)</p>\r\n\r\n<p dir=\"ltr\"><strong>Answer:</strong> The correct c. Because, zip function binds the element from x and y and returns a tuple.</p>\r\n\r\n<p dir=\"ltr\"><br />\r\n<strong>Q4.&nbsp; What will be the output after the following statements</strong>?<br />\r\n<br />\r\n&nbsp;x = &#39;Python&#39;<br />\r\nprint(x.join(&#39;33&#39;))</p>\r\n\r\n<p dir=\"ltr\"><strong>Options</strong>: Python33 ,&nbsp; 3Python3 , Python3 , Python 33</p>\r\n\r\n<p dir=\"ltr\"><strong>Answer</strong>: The correct answer is 3Python3. Because, join function on strings will add the given string (X) between the string 33.</p>\r\n\r\n<p dir=\"ltr\"><br />\r\n<strong>Q5. What will be the output after the following statements?</strong><br />\r\na = True<br />\r\nb = False<br />\r\nc = &#39;a&#39; if (b == 0) else &#39;b&#39;;print(c)</p>\r\n\r\n<p dir=\"ltr\"><strong>Options</strong>: True , False , a , error</p>\r\n\r\n<p dir=\"ltr\"><strong>Answer</strong>: The correct answer is a. The if statement evaluates to True as False is considered 0. So it will print a as the output.</p>\r\n\r\n<p dir=\"ltr\">&nbsp;</p>\r\n\r\n<p dir=\"ltr\">