strong>Options</strong>:&nbsp;</p>\r\n\r\n<p dir=\"ltr\">a. (&#39;P&#39;)(&#39;y&#39;)(&#39;t&#39;)(&#39;h&#39;)(&#39;o&#39;)(&#39;n&#39;)&nbsp;</p>\r\n\r\n<p dir=\"ltr\">b. python 0 1 2 3 4 5&nbsp;</p>\r\n\r\n<p dir=\"ltr\">c. (&#39;p&#39;, &#39;0&#39;)(&#39;y&#39;, &#39;1&#39;)(&#39;t&#39;, &#39;2&#39;)(&#39;h&#39;, &#39;3&#39;)(&#39;o&#39;, &#39;4&#39;)(&#39;n&#39;, &#39;5&#39;)&nbsp;</p>\r\n\r\n<p dir=\"ltr\">d. (0, &#39;P&#39;)(1, &#39;y&#39;)(2, &#39;t&#39;)(3, &#39;h&#39;)(4, &#39;o&#39;)(5, &#39;n&#39;)</p>\r\n\r\n<p dir=\"ltr\"><strong>Answer:</strong> The correct c. Because, zip function binds the element from x and y and returns a tuple.</p>\r\n\r\n<p dir=\"ltr\"><br />\r\n<strong>Q4.&nbsp; What will be the output after the following statements</strong>?<br />\r\n<br />\r\n&nbsp;x = &#39;Python&#39;<br />\r\nprint(x.join(&#39;33&#39;))</p>\r\n\r\n<p dir=\"ltr\"><strong>Options</strong>: Python33 ,&nbsp; 3Python3 , Python3 , Python 33</p>\r\n\r\n<p dir=\"ltr\"><strong>Answer</strong>: The correct answer is 3Python3. Because, join function on strings will add the given string (X) between the string 33.</p>\r\n\r\n<p dir=\"ltr\"><br />\r\n<strong>Q5. What will be the output after the following statements?</strong><br />\r\na = True<br />\r\nb = False<br />\r\nc = &#39;a&#39; if (b == 0) else &#39;b&#39;;print(c)</p>\r\n\r\n<p dir=\"ltr\"><strong>Options</strong>: True , False , a , error</p>\r\n\r\n<p dir=\"ltr\"><strong>Answer</strong>: The correct answer is a.</p>\r\n\r\n<p dir=\"ltr\">The if statement evaluates to True as False is considered 0. So it will print a as the output.</p>\r\n\r\n<p dir=\"ltr\">Looking forward to seeing you answering the next Friday&#39;s quiz.</p>\r\n\r\n<p dir=\"ltr\">To get a reminder, <a href=\"http://m.me/codegnan?ref=:t-1601018222458\">Click Here</a></p>\r\n\r\n<p dir=\"ltr\">&nbsp;</p>\r\n\r\n<p dir=\"ltr\">Thank you,<br />\r\nSaketh<br />\r\n<a href=\"https://codegnan.com/courses/?utm_source=weeklyquiz&amp;utm_medium=email&amp;utm_campaign=Courses\">200 Hours of Courses - Details</a></p>\r\n\r\n<p>&nbsp;</p>\r\n</body>\r\n</html>\r\n','','1604894200',7,'',7,NULL,'36:US,51:CA,162:US,176:US,51:US',1,NULL,NULL,'','','5','',NULL,NULL,0,0,1,1),(7,1,2,'Codegnan','info@codegnan.com','info@codegnan.com','What is your Friday\\\'s Python Quiz Score','','','<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Hello [Name],</p>\r\n\r\n<p>Hope you are enjoying the weekly Python quiz!</p>\r\n\r\n<p>We have been doing these weekly quizes and giving away 2000 INR off on our courses to people who answers all the questions right on every Friday of that month.</p>\r\n\r\n<p>To not miss the chance, Hit the &#39;<a href=\"https://m.me/codegnan?ref=:t-1601018222458\">Notify Me</a>&#39; to get the quiz in your Messenger on every Friday!<br />\r\n<br />\r\nBy the way, the dates for the next batch Machine Learning and Augmented Reality courses were announced. <a href=\"https://codegnan.com/courses/?utm_source=weeklyquiz&amp;utm_medium=email&amp;utm_campaign=Courses\">Click here</a> to check out full length course structures in detail!</p>\r\n\r\n<p>You received this email because you have answered all the questions on Friday in the quiz bot and opted for explanations. Here you go!</p>\r\n\r\n<p dir=\"ltr\"><br />\r\n<strong>Q1. What is the output after the following Python code?</strong></p>\r\n\r\n<p dir=\"ltr\">a = {10,23,45,89,90}</p>\r\n\r\n<p dir=\"ltr\">b = {1,10,24,89,90}</p>\r\n\r\n<p dir=\"ltr\">print(a.symmetric_difference(b))</p>\r\n\r\n<p dir=\"ltr\"><strong>Options:&nbsp; </strong></p>\r\n\r\n<ol>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\" role=\"presentation\">{1,23,24,45}</p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\" role=\"presentation\">{23,45}</p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\" role=\"presentation\">{1,10,23,24,45,89,90}</p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\" role=\"presentation\">Error</p>\r\n	</li>\r\n</ol>\r\n\r\n<p dir=\"ltr\">Answer: The correct answer is<meta charset=\"utf-8\"> {1,23,24,45}. Because, <meta charset=\"utf-8\">symmetric_difference() will return a set with the elements that are there in either a or b but not in both</p>\r\n\r\n<p dir=\"ltr\"><br />\r\n<strong>Q2. What will be the output after the following Python code?</strong></p>\r\n\r\n<p dir=\"ltr\" role=\"presentation\">x = [i**+1 for i in range(3)]; print(x);</p>\r\n\r\n<p dir=\"ltr\"><strong>Options</strong>: <meta charset=\"utf-8\"></p>\r\n\r\n<ol>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\" role=\"presentation\">[0,1,2]</p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\" role=\"presentation\">error,**+ is not valid operator</p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\" role=\"presentation\">error, ; is not allowed</p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\" role=\"presentation\">[1,2,5]</p>\r\n	</li>\r\n</ol>\r\n\r\n<p><strong>Answer</strong>: The correct answer is [0,1,2]. Because, i**+1 is evaluated as (i)**(+1).</p>\r\n\r\n<p dir=\"ltr\" role=\"presentation\"><br />\r\n<strong>Q3. What is the output after the following Python code?</strong><br />\r\n<br />\r\n<meta charset=\"utf-8\"> l1=[1,2,3]</p>\r\n\r\n<p dir=\"ltr\" role=\"presentation\">l2=[4,5,6]</p>\r\n\r\n<p dir=\"ltr\" role=\"presentation\">x = [sum(x*y) for x in l1 for y in l2]</p>\r\n\r\n<p dir=\"ltr\" role=\"presentation\">print(x)</p>\r\n\r\n<p dir=\"ltr\" role=\"presentation\"><strong>Options</strong>: 90 ,&nbsp; [4,10,18] , [4,5,6,8,10,12,12,15,18] , Error</p>\r\n\r\n<p><strong>Answer:</strong> The correct answer is Error. Because, int object is not iterable we cannot do sum(x*y)</p>\r\n\r\n<p dir=\"ltr\" role=\"presentation\"><br />\r\n<strong>Q4.&nbsp; What will be the output after the following Python Code</strong>?<br />\r\n<br />\r\n<meta charset=\"utf-8\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; print(0xA + 0xB + 0xC)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p dir=\"ltr\" role=\"presentation\"><strong>Options</strong>: <meta charset=\"utf-8\">0xA0xB0xC, Error, 0x22 , 33</p>\r\n\r\n<p dir=\"ltr\"><strong>Answer</strong>: The correct answer is 33. Because, <meta charset=\"utf-8\">0xA and 0xB and 0xC are hexadecimal integer literal representing the decimal values 10, 11 and 12 respectively. Their sum is 33.</p>\r\n\r\n<p dir=\"ltr\"><br />\r\n<strong>Q5. What will be the output of the following Python code snippet if X=1?</strong></p>\r\n\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; print(x&lt;&lt;2)</p>\r\n\r\n<p dir=\"ltr\"><strong>Options</strong>: 4, 2, 8, 1</p>\r\n\r\n<p dir=\"ltr\"><strong>Answer</strong>: The correct answer is 4. The binary form of 1 is 0001. The expression x&lt;&lt;2 implies we are performing a bitwise left shift on x. This shift yields the value: 0100, which is the binary form of the number 4.</p>\r\n\r\n<p dir=\"ltr\">&nbsp;</p>\r\n\r\n<p dir=\"ltr\">Looking forward to seeing you answering the next Friday&#39;s quiz.</p>\r\n\r\n<p dir=\"ltr\">To get a reminder, <a href=\"http://m.me/codegnan?ref=:t-1601018222458\">Click Here</a></p>\r\n\r\n<p dir=\"ltr\">&nbsp;</p>\r\n\r\n<p dir=\"ltr\">Thank you,<br />\r\nSaketh<br />\r\n<a href=\"https://codegnan.com/courses/?utm_source=weeklyquiz&amp;utm_medium=email&amp;utm_campaign=Courses\">200 Hours of Courses - Details</a></p>\r\n</body>\r\n</html>\r\n','','1605437015',5,'',5,NULL,'184:US,44:US,184:US',1,NULL,NULL,'','','6','',NULL,NULL,0,0,1,1),(8,1,2,'Codegnan','info@codegnan.com','info@codegnan.com','Here is the explanation to the Friday Python Quiz','','','<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Hello [Name],</p>\r\n\r\n<p>Hope you are enjoying the weekly Python quiz!</p>\r\n\r\n<p>We have been doing these weekly quizes and giving away 2000 INR off on our courses to people who answers all the questions right on every Friday of that month.</p>\r\n\r\n<p>To not miss the chance, Hit the &#39;<a href=\"https://m.me/codegnan?ref=:t-1601018222458\">Notify Me</a>&#39; to get the quiz in your Messenger on every Friday!<br />\r\n<br />\r\nBy the way, the dates for the next batch Machine Learning and Augmented Reality courses were announced. <a href=\"https://codegnan.com/courses/?utm_source=weeklyquiz&amp;utm_medium=email&amp;utm_campaign=Courses\">Click here</a> to check out full length course structures in detail!</p>\r\n\r\n<p>You received this email because you have answered all the questions on Friday in the quiz bot and opted for explanations. Here you go!</p>\r\n\r\n<p dir=\"ltr\"><br />\r\n<strong>Q1. What is the output after the following Python code?</strong></p>\r\n\r\n<p dir=\"ltr\">d1={&quot;abc&quot;:5,&quot;def&quot;:6,&quot;ghi&quot;:7}</p>\r\n\r\n<p dir=\"ltr\">print(d1.get(&ldquo;ABC&rdquo;))</p>\r\n\r\n<p dir=\"ltr\"><strong>Options: </strong>abc , 5 , Error , None</p>\r\n\r\n<p dir=\"ltr\"><strong>Answer</strong>: None. The key ABC is not in the dictionary so it will return None.</p>\r\n\r\n<p dir=\"ltr\"><br />\r\n<strong>Q2. What will be the output after the following Python code?</strong></p>\r\n\r\n<p dir=\"ltr\">tupl=()</p>\r\n\r\n<p dir=\"ltr\">tupl1=tupl*2</p>\r\n\r\n<p dir=\"ltr\">print(len(tupl1))</p>\r\n\r\n<p dir=\"ltr\"><strong>Options</strong>: <meta charset=\"utf-8\">0 , 2 , 1 ,&nbsp; Error as tuple object has no attribute to len</p>\r\n\r\n<p><strong>Answer</strong>: The correct answer is 0 .</p>\r\n\r\n<p dir=\"ltr\"><br />\r\n<strong>Q3. What is the output after the following Python code?</strong><br />\r\n<br />\r\ndef function1(var1=5, var2=7):</p>\r\n\r\n<p dir=\"ltr\">&nbsp;&nbsp;&nbsp;&nbsp;var2=9</p>\r\n\r\n<p dir=\"ltr\">&nbsp;&nbsp;&nbsp;&nbsp;var1=3</p>\r\n\r\n<p dir=\"ltr\">&nbsp;&nbsp;&nbsp;&nbsp;print (var1, &quot; &quot;, var2)</p>\r\n\r\n<p dir=\"ltr\">A = function1(10,12)</p>\r\n\r\n<p dir=\"ltr\">print(A)</p>\r\n\r\n<p dir=\"ltr\" role=\"presentation\"><strong>Options</strong>: 5 7 , 3 9 , 10 12 , None</p>\r\n\r\n<p dir=\"ltr\"><strong>Answer:</strong> The correct answer is None. Because, the function is not returning anything so the output will be none.</p>\r\n\r\n<p dir=\"ltr\"><br />\r\n<strong>Q4.&nbsp; What will be the output after the following Python Code</strong>?<br />\r\n<br />\r\n<meta charset=\"utf-8\">def fn(var1):</p>\r\n\r\n<p dir=\"ltr\">&nbsp;&nbsp;&nbsp;&nbsp;var1.pop(1)</p>\r\n\r\n<p dir=\"ltr\">var1=[1,2,3]</p>\r\n\r\n<p dir=\"ltr\">fn(var1)</p>\r\n\r\n<p dir=\"ltr\">print(var1)</p>\r\n\r\n<p dir=\"ltr\" role=\"presentation\"><strong>Options</strong>: <meta charset=\"utf-8\">[1 2 3] , [1,3] , [2,3] , [1,2]</p>\r\n\r\n<p dir=\"ltr\"><strong>Answer</strong>: The correct answer is [1,2]. Because, pop will remove the last element from the list on priority basis as even pop removes according to index position.</p>\r\n\r\n<p dir=\"ltr\"><br />\r\n<strong>Q5. What will be the output of the following Python code snippet if X=1?</strong></p>\r\n\r\n<p dir=\"ltr\">tupl=([2,3],&quot;abc&quot;,0,9)</p>\r\n\r\n<p dir=\"ltr\">tupl[0][1]=1</p>\r\n\r\n<p dir=\"ltr\">print(tupl)</p>\r\n\r\n<p dir=\"ltr\"><strong>Options</strong>:</p>\r\n\r\n<p dir=\"ltr\">A. ([2,3],&quot;abc&quot;,0,9)</p>\r\n\r\n<p dir=\"ltr\">B. ([1,3],&quot;abc&quot;,0,9)</p>\r\n\r\n<p dir=\"ltr\">C. ([2,1],&quot;abc&quot;,0,9)</p>\r\n\r\n<p dir=\"ltr\">D. Error</p>\r\n\r\n<p dir=\"ltr\"><strong>Answer</strong>: The correct answer is C. Because, <meta charset=\"utf-8\">tupl[0] will give us the list and in that list we are changing the element at index 1 to 1.</p>\r\n\r\n<p dir=\"ltr\">Looking forward to seeing you answering the next Friday&#39;s quiz.</p>\r\n\r\n<p dir=\"ltr\">To get a reminder, <a href=\"http://m.me/codegnan?ref=:t-1601018222458\">Click Here</a></p>\r\n\r\n<p dir=\"ltr\">&nbsp;</p>\r\n\r\n<p dir=\"ltr\">Thank you,<br />\r\nSaketh<br />\r\n<a href=\"https://codegnan.com/courses/?utm_source=weeklyquiz&amp;utm_medium=email&amp;utm_campaign=Courses\">200 Hours of Courses - Details</a></p>\r\n\r\n<p>&nbsp;</p>\r\n</body>\r\n</html>\r\n','','1606117133',32,'',32,NULL,'44:US,191:US,208:CA,201:US,201:US,190:US,193:US,202:US,37:US,197:US,38:US,200:CA,54:CA,54:CA',1,NULL,NULL,'','','7','',NULL,NULL,0,0,1,1),(9,1,2,'Codegnan','info@codegnan.com','info@codegnan.com','What was your Friday\\\'s Python quiz score?','','','<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Hello [Name],</p>\r\n\r\n<p>Hope you are enjoying the weekly Python quiz!</p>\r\n\r\n<p>We have been doing these weekly quizes and giving away 2000 INR off on our courses to people who answers all the questions right on every Friday of that month.</p>\r\n\r\n<p>To not miss the chance, Hit the &#39;<a href=\"https://m.me/codegnan?ref=:t-1601018222458\">Notify Me</a>&#39; to get the quiz in your Messenger on every Friday!<br />\r\n<br />\r\nBy the way, the dates for the next batch Machine Learning and Augmented Reality courses were announced. <a href=\"https://codegnan.com/courses/?utm_source=weeklyquiz&amp;utm_medium=email&amp;utm_campaign=Courses\">Click here</a> to check out full length course structures in detail!</p>\r\n\r\n<p>You received this email because you have answered all the questions on Friday in the quiz bot and opted for explanations. Here you go!</p>\r\n\r\n<p dir=\"ltr\"><br />\r\n<strong>Q1. What is the output after the following Python code?</strong></p>\r\n\r\n<p dir=\"ltr\">a&nbsp; = [10,20,8,9,23,9,25]</p>\r\n\r\n<p dir=\"ltr\">a.remove(9)</p>\r\n\r\n<p dir=\"ltr\">print(a[2 : 12])</p>\r\n\r\n<p dir=\"ltr\" role=\"presentation\"><strong>Options: </strong>Error , [8,23,9,25] , [8,23,25] , [20,8,9,23,9,25]</p>\r\n\r\n<p dir=\"ltr\"><strong>Answer</strong>:&nbsp; The right option is [8,23,9,25]. Because, a.remove(9) will remove the first occurrence of the&nbsp; specified element . And if we give the end index value larger than the length of the end index when slicing it is going to consider&nbsp; till the end index only.&nbsp;</p>\r\n\r\n<p dir=\"ltr\"><br />\r\n<strong>Q2. What will be the output after the following Python code?</strong></p>\r\n\r\n<p dir=\"ltr\">def my_gen():</p>\r\n\r\n<p dir=\"ltr\">&nbsp;&nbsp;&nbsp;&nbsp; n = 1</p>\r\n\r\n<p dir=\"ltr\">&nbsp;&nbsp;&nbsp;&nbsp; yield n</p>\r\n\r\n<p dir=\"ltr\">&nbsp;&nbsp;&nbsp;&nbsp; n += 5</p>\r\n\r\n<p dir=\"ltr\">&nbsp;&nbsp;&nbsp; yield n</p>\r\n\r\n<p dir=\"ltr\">a = my_gen()</p>\r\n\r\n<p dir=\"ltr\">print(next(a),next(a))</p>\r\n\r\n<p dir=\"ltr\" role=\"presentation\"><strong>Options</strong>: error , 1 7 ,&nbsp; 5 , 1 6</p>\r\n\r\n<p dir=\"ltr\">Answer: The correct answer is 1 6. Because, This is a generator function which works like an iterator so whenever we use the next function it is going to print the next value of n. Here we are using next in same line so it will be printed 1 6</p>\r\n\r\n<p dir=\"ltr\"><br />\r\n<strong>Q3. What is the output after the following Python code?</strong></p>\r\n\r\n<p dir=\"ltr\">a = &ldquo;Codegnan&rdquo;</p>\r\n\r\n<p dir=\"ltr\">a.upper()</p>\r\n\r\n<p dir=\"ltr\">print(a.find(&ldquo;O&rdquo;))</p>\r\n\r\n<p dir=\"ltr\" role=\"presentation\"><strong>Options</strong>: O , 1 , error , -1</p>\r\n\r\n<p dir=\"ltr\"><strong>Answer:</strong> The correct answer is -1. Because, - a.upper() is not going to make changes in our a. So when we query for &ldquo; O&rdquo; the output will be -1. As find returns -1 when the pattern/character is not present in the string.</p>\r\n\r\n<p dir=\"ltr\"><br />\r\n<strong>Q4.&nbsp; What will be the output after the following Python Code</strong>?</p>\r\n\r\n<p dir=\"ltr\">car = {&quot;brand&quot;: &quot;Ford&quot;,</p>\r\n\r\n<p dir=\"ltr\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&quot;model&quot;: &quot;Mustang&quot;,</p>\r\n\r\n<p dir=\"ltr\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&quot;year&quot;: 1964}</p>\r\n\r\n<p dir=\"ltr\">x = car.setdefault(&#39;model&#39;, &#39;Bronco&#39;)&nbsp;&nbsp;</p>\r\n\r\n<p dir=\"ltr\">print(x)</p>\r\n\r\n<p dir=\"ltr\" role=\"presentation\"><strong>Options</strong>: {&lsquo;model&rsquo; : &lsquo;Bronco&rsquo;} , Bronco , Mustang , {&ldquo;Brand&rdquo; : &ldquo;Ford&rdquo;, &ldquo;model&rdquo; : &ldquo;Bronco&rdquo;, &ldquo;year&rdquo; : 1964}</p>\r\n\r\n<p dir=\"ltr\"><strong>Answer</strong>: The correct answer is Mustang. Because, - setdefault() will return the Mustang as the key is there in our car dictionary.</p>\r\n\r\n<p dir=\"ltr\"><br />\r\n<strong>Q5. What will be the output of the following Python code?</strong></p>\r\n\r\n<p dir=\"ltr\">a = {&lsquo;Name&rsquo; : &lsquo;Rahul&rsquo;, &lsquo;Age&rsquo; : 23, &lsquo;Place&rsquo; : &lsquo;India&rsquo;}</p>\r\n\r\n<p dir=\"ltr\">print(a.get(&lsquo;City&rsquo;))</p>\r\n\r\n<p dir=\"ltr\" role=\"presentation\"><strong>Options</strong>: None ,&nbsp; -1 , {&lsquo;City&rsquo; : []} , error</p>\r\n\r\n<p dir=\"ltr\"><strong>Answer</strong>: The correct answer is None. Because, <strong><meta charset=\"utf-8\"></strong> <meta charset=\"utf-8\">The output of the above code is None&nbsp; as the key City is not present in the dictionary so it will return None.</p>\r\n\r\n<p dir=\"ltr\">Looking forward to seeing you answering the next Friday&#39;s quiz.</p>\r\n\r\n<p dir=\"ltr\">To get a reminder, <a href=\"http://m.me/codegnan?ref=:t-1601018222458\">Click Here</a></p>\r\n\r\n<p dir=\"ltr\">&nbsp;</p>\r\n\r\n<p dir=\"ltr\">Thank you,<br />\r\nSaketh<br />\r\n<a href=\"https://codegnan.com/courses/?utm_source=weeklyquiz&amp;utm_medium=email&amp;utm_campaign=Courses\">200 Hours of Courses - Details</a></p>\r\n\r\n<p>&nbsp;</p>\r\n</body>\r\n</html>\r\n','','1606710118',4,'',4,NULL,'222:US,37:CA',1,NULL,NULL,'','','8','',NULL,NULL,0,0,1,1),(10,1,2,'Codegnan','info@codegnan.com','info@codegnan.com','How much did you score in Friday\\\'s Python quiz?','','','<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Hello [Name],</p>\r\n\r\n<p>Hope you are enjoying the weekly Python quiz!</p>\r\n\r\n<p>We have been doing these weekly quizes and giving away 2000 INR off on our courses to people who answers all the questions right on every Friday of that month.</p>\r\n\r\n<p>To not miss the chance, Hit the &#39;<a href=\"https://m.me/codegnan?ref=:t-1601018222458\">Notify Me</a>&#39; to get the quiz in your Messenger on every Friday!<br />\r\n<br />\r\nBy the way, the dates for the next batch Machine Learning and Augmented Reality courses were announced. <a href=\"https://codegnan.com/courses/?utm_source=weeklyquiz&amp;utm_medium=email&amp;utm_campaign=Courses\">Click here</a> to check out full length course structures in detail!</p>\r\n\r\n<p>You received this email because you have answered all the questions on Friday in the quiz bot and opted for explanations. Here you go!</p>\r\n\r\n<p dir=\"ltr\"><br />\r\n<strong>Q1. What is the output after the following Python code?</strong></p>\r\n\r\n<p dir=\"ltr\">&nbsp;sr=&#39;Gnan Stars&#39;</p>\r\n\r\n<p dir=\"ltr\">print(sr.rfind(&#39;s&#39;))</p>\r\n\r\n<p dir=\"ltr\" role=\"presentation\"><strong>Options: </strong>9 , 2 , 4 , 5</p>\r\n\r\n<p dir=\"ltr\"><strong>Answer</strong>:&nbsp; The right answer is 9. Because, <meta charset=\"utf-8\">finds the last occurrence of specified letter</p>\r\n\r\n<p dir=\"ltr\"><br />\r\n<strong>Q2. What will be the output after the following Python code?</strong></p>\r\n\r\n<p dir=\"ltr\">st = &lsquo;The quick brown fox jumps over the lazy dog&rsquo;</p>\r\n\r\n<p dir=\"ltr\">print(st.split().index(&lsquo;lazy&rsquo;))</p>\r\n\r\n<p dir=\"ltr\" role=\"presentation\"><strong>Options</strong>: -7 , 7 , 8 , 9</p>\r\n\r\n<p dir=\"ltr\">Answer: The correct answer is 7. Because, split will split each words into list and in list index of lazy is 7</p>\r\n\r\n<p dir=\"ltr\"><br />\r\n<strong>Q3. What is the output after the following Python code?</strong></p>\r\n\r\n<p dir=\"ltr\">L1 = [1,4,9]</p>\r\n\r\n<p dir=\"ltr\">print(L1.append([12,[10,11]]),end= &lsquo;&rsquo;)</p>\r\n\r\n<p dir=\"ltr\">print(L1.pop(),end= &lsquo;&rsquo;)</p>\r\n\r\n<p dir=\"ltr\" role=\"presentation\"><strong>Options</strong>: <meta charset=\"utf-8\"></p>\r\n\r\n<p dir=\"ltr\" role=\"presentation\">A. None [12,[10,11]]</p>\r\n\r\n<p dir=\"ltr\" role=\"presentation\">B. None</p>\r\n\r\n<p dir=\"ltr\" role=\"presentation\">C. [1,4,9]</p>\r\n\r\n<p dir=\"ltr\" role=\"presentation\">D. [1,4,9,[12,10]]</p>\r\n\r\n<p dir=\"ltr\">Answer: The correct option is A. Because, <meta charset=\"utf-8\">First print will give None and when we use pop it will pop the last element i.e [12,[10,11]] and print it.</p>\r\n\r\n<p dir=\"ltr\"><br />\r\n<strong>Q4.&nbsp; What will be the output after the following Python Code</strong>?</p>\r\n\r\n<p dir=\"ltr\">a = 2</p>\r\n\r\n<p dir=\"ltr\">b = 3</p>\r\n\r\n<p dir=\"ltr\">c = &lsquo;3.77&rsquo;</p>\r\n\r\n<p dir=\"ltr\">print(&lsquo;{0:.4f}&rsquo;.format(a,b,c))</p>\r\n\r\n<p dir=\"ltr\" role=\"presentation\"><strong>Options</strong>:&nbsp; Error , 2.0000 , 2 , 2.00</p>\r\n\r\n<p dir=\"ltr\"><strong>Answer</strong>: The correct answer is 2.0000. Because, .4f will convert the integer into decimal with 4 decimal places and in format we have passed 3 it will take the first value i.e., a.</p>\r\n\r\n<p dir=\"ltr\"><br />\r\n<strong>Q5. What will be the output of the following Python code?</strong></p>\r\n\r\n<p dir=\"ltr\">str1 = &ldquo;Hello Folks&rdquo;</p>\r\n\r\n<p dir=\"ltr\">print(str1.split()[0][: : -1])</p>\r\n\r\n<p dir=\"ltr\" role=\"presentation\"><strong>Options</strong>:&nbsp; Folks Hello , olleH , Hello Folks , skloF</p>\r\n\r\n<p dir=\"ltr\"><strong>Answer</strong>: The correct answer is olleH. Because, When we split it , it will give us list from the list we are selecting the element at position 0 and then reversing it</p>\r\n\r\n<p dir=\"ltr\">&nbsp;</p>\r\n\r\n<p dir=\"ltr\">Looking forward to seeing you answering the next Friday&#39;s quiz.</p>\r\n\r\n<p dir=\"ltr\">To get a reminder, <a href=\"http://m.me/codegnan?ref=:t-1601018222458\">Click Here</a></p>\r\n\r\n<p dir=\"ltr\">&nbsp;</p>\r\n\r\n<p dir=\"ltr\">Thank you,<br />\r\nSaketh<br />\r\n<a href=\"https://codegnan.com/courses/?utm_source=weeklyquiz&amp;utm_medium=email&amp;utm_campaign=Courses\">200 Hours of Courses - Details</a></p>\r\n\r\n<p>&nbsp;</p>\r\n</body>\r\n</html>\r\n','','1607399735',21,'',21,NULL,'237:US,205:US,77:US,238:US,211:US,229:US,37:US,235:US,233:US,139:US,234:US,207:US,222:US,42:US,239:US,237:US',1,NULL,NULL,'','','9','',NULL,NULL,0,0,1,1);
